sap.ui.define(["sap/ui/core/mvc/Controller"], function (Controller) {
	"use strict";
	return Controller.extend("ui5.ui5.controller.View1", {
		onInit: function () {
			var optionList = this.getView().byId("optionList");
			optionList.setSelectedKey("option1");
		},
		/**
		 *@memberOf ui5.ui5.controller.View1
		 */
		onButton: function (oEvent) {
			// This code was generated by the layout editor.
			var fileUploader = this.getView().byId("fileUploader");
			var domRef = fileUploader.getFocusDomRef();
			var file = domRef.files[0];
			var optionList = this.getView().byId("optionList");
			var selectedOption = optionList.getSelectedKey();
			var resultPanel = this.getView().byId("resultPanel");
			if (file == null && selectedOption != "option4") {
				sap.m.MessageToast.show("Please upload a file.");
				return;
			}
			var fileName;
			if (selectedOption != "option4") {
				fileName = file.name;
			} else {
				fileName = "null";
			}
			var formData = new FormData();
			// formData.append("files", file, fileName);

			resultPanel.setBusy(true);
			$.ajax({
				url: '/node/leonardo/url',
				timeout: 3600000,
				// 'Accept': 'application/json',
				// 'Accept' : 'multipart/form-data',
				type: 'post',
				// processData: false,
				// contentType: false,
				data: {
					option: selectedOption
				},
				success: (data) => {
					console.log("[SUCCESS]", data);
					var headers;
					var url;
					var req_data;
					switch (data.api_type) {
					case "sap":
						formData.append(data.ftype, file, fileName);
						headers = {
							'apiKey': data.api_key,
							'Accept': 'application/json'
						};
						url = data.url;
						req_data = formData;
						break;
					case "google":
						headers = {
							'Content-Type': 'application/json'
						};
						url = data.url;
						req_data = {
							"requests": [{
								"image": {
									"content": ""
								},
								"features": [{
									"type": "DOCUMENT_TEXT_DETECTION"
								}]
							}]
						}
						req_data = JSON.stringify(req_data);
						break;
					default:
						break;
					}
					// formData.append(data.ftype, file, fileName);
					for (let [key, value] of formData.entries()) {
						console.log(key, value);
					}

					$.ajax({
						url: url,
						timeout: 360000,
						type: 'post',
						headers: headers,
						contentType: false,
						processData: false,
						data: req_data,
						success: (data_final) => {
							console.log('[SUCCESS]', data_final);
							if (data.api_type == "sap") {
								this.drawImage(file, selectedOption);
							} else {
								this.drawImage("");
							}
							this.drawText(data_final);
							resultPanel.setBusy(false);
						},
						error: (err) => {
							console.error('[ERROR]', err);
							resultPanel.setBusy(false);
						}
					});
				},
				error: (err) => {
					console.error("[ERROR]", err);
					resultPanel.setBusy(false);
				}
			});
		},
		drawImage: function (baseImage, option) {
			var image = this.getView().byId("image");
			if (baseImage == "") {
				image.setSrc("//:0");
			} else {
				var path = URL.createObjectURL(baseImage);
				image.setSrc(path);
			}

			// var textOutput = this.getView().byId("textOutput");
			// textOutput.setText(JSON.stringify(data));

			// var formData = new FormData();
			// var fileName = baseImage.name;
			// formData.append("files", baseImage, fileName);

			// $.ajax({
			// 	url: '/node/image/box',
			// 	type: 'post',
			// 	timeout: 36000,
			// 	processData: false,
			// 	contentType: false,
			// 	data: formData,
			// 	success: (data) => {
			// 		console.log(data);
			// 	},
			// 	error: (err) => {
			// 		console.error(err);
			// 	}
			// });
			////
		},
		drawText: function (text) {
			var textOutput = this.getView().byId("textOutput");
			textOutput.setText(JSON.stringify(text));
		}
	});
});